import React, {useEffect, useState} from 'react';
import './styles/App.css';
import {getUsers} from "./requestData";

function App() {

    const [users, setUsers] = useState([])

    useEffect(() => {
        setUsers(getUsers())
    }, [])

  return (
    <div className="app">
        {
            users && users.length
                ? users.map(el => (
                    <div>{el.id}</div>
                ))
                : null
        }
    </div>
  );
}

export default App;
